South Carolina, one of the founding members of the "Confederate States of America", was the first slave state to secede from the United States with an ordinance adopted in December 1860. The declaration was a product of a November convention organized following the election of Abraham Lincoln as the president of the United States. The declaration claimed the secession was a result of the free states refusals to enforce the "Fugitive Slave Act". South Carolinians were compelled to secede because Lincoln supported equality and civil rights for African Americans as well as the abolition of slavery, to which they were opposed. Two months later, delegates from South Carolina, Florida, Georgia, Alabama, Mississippi, and Louisiana, met to form a new constitution and government modeled on that of the United States. The opening shots of the Civil War occurred at Fort Sumter, the beleaguered US garrison in Charleston Harbor. "The triumphs of Christianity rest this very hour upon slavery; and slavery depends on the triumphs of the South . . . This war is the servant of slavery." -- John T Wrightman, 'The Glory of God, the Defense of the South, (1861).

